import { createRouter, createWebHistory } from "vue-router";
import PLKView from "../views/Plk.vue";
import MainPage from "../views/MainPage.vue";

const routes = [
  {
    path: "/",
    name: "Main",
    component: MainPage,
  },
  {
    path: "/plk",
    name: "PLKView",
    component: PLKView,
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
